n_flights.index:
function(doc){
	    index("default", doc._id);
    	    if(doc.flightSegmentId){
           	index("flightSegmentId", doc.flightSegmentId, {"store": "yes"});
    	    }
    	    if(doc.scheduledDepartureTime){
           	index("scheduledDepartureTime", doc.scheduledDepartureTime, {"store": "yes"});
    	    }
}
